  true,\n\t\"url\": null,\n\t\"notes\": \"<p>In the systematic review, we identified
  22 pooled, 17 repeated cross-sectional, and 17 longitudinal studies. Less than half
  of these studies explicitly described the weighting approach or variance estimation.
  In the empirical demonstration, we showed that different study designs and weighting
  approaches will yield statistically different estimates.</p>n\",\n\t\"license_title\":
